<?php $__env->startSection('content'); ?><p>Jackie 'O' Henderson recently moved into her new $11million property in Woollahra, Sydney, known as Cooper Park House. </p>

<p>And on Thursday, the 45-year-old gave fans a peek inside the property as she unpacked with her nine-year-old daughter, Kitty. </p>

<p>Posting to Instagram, the radio host shared a boomerang featuring herself and her daughter posing with several boxes from homeware store, Peter's of Kensington. </p>

<p>Making it a home: On Thursday, Jackie O Henderson gave fans a peek inside her new home as she unpacked with her nine-year-old daughter, Kitty. Both pictured</p>

<p>'Making our new house a home,' she captioned the boomerang. </p>

<p>In the clip, Jackie and her daughter looked excited as they raised their arms in the air and swayed back and forth. </p>

<p>Jackie looked chic in a long-sleeved black shirt, and she wore her blonde locks loose with minimal makeup. </p>

<p>Meanwhile, Kitty looked over the moon in what appeared to be a patterned white T-shirt. </p>

<p>Home sweet home: The mother-daughter-duo (pictured) showed off the homes stunning hardwood floors and its leafy backyard view</p>

<p>Stunning: The Woollahra estate has a large open living room with glass windows soaking in the beautiful greenery of Cooper Park</p>

<p>The mother-daughter-duo showed off the homes stunning hardwood floors and its leafy backyard view in the clip.  </p>

<p>The private sanctuary has extravagant design features, including Roman Travertine marble and dark timber panelling.</p>

<p>It also boasts a resort-style pool and has a large open living room with glass windows. </p>

<p>Big purchase: While it's unclear exactly how much Jackie paid for her new house, real estate agents have predicted it would sell for close to $11million</p>

<p>While it's unclear exactly how much Jackie paid for her new house, real estate agents predicted it would sell for close to $11million.</p>

<p>The purchase comes after Jackie and her ex-husband, Lee Henderson, sold their former marital home in Vaucluse in March for $6.675million.</p>

<p>Jackie was married to Lee from 2003 to 2018, and they share custody of daughter, Kitty, together.  </p>

